<h2>Drug brand info</h2>

<h3>Description</h3>

<p>A dataset containing a unique record for each the drug categories and their respective brand names.
</p>


<h3>Usage</h3>

<pre><code class="language-R">data(dea_brands)
</code></pre>


<h3>Format</h3>

<p>A tibble with 28 rows and 2 variables:
</p>

<dl>
<dt>category</dt>
<dd>
<p>the drug category</p>
</dd>
<dt>brands</dt>
<dd>
<p>Drug brand name</p>
</dd>
</dl>
